import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import MyTeam from './myteam/index.js'; // Adjust the path as needed
import AnotherComponent from './AnotherComponent'; // Import other components as needed
import NotFound from './NotFound'; // Import a NotFound component for handling 404 errors

import './App.css';

function App() {
  return (
    <Router>
      <div>

        <Switch>
          <Route path="/" exact component={MyTeam} />
          <Route component={NotFound} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
